import React, { useState, useEffect, useMemo } from 'react';
import { getHistory } from '../services/api';
import { useReactTable, getCoreRowModel } from '@tanstack/react-table';

function History() {
  const [history, setHistory] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const response = await getHistory();
        setHistory(response.data);
      } catch (err) {
        setError('Failed to fetch history');
      }
    };
    fetchHistory();
  }, []);

  // Define columns for the table
  const columns = useMemo(
    () => [
      {
        accessorKey: 'datasetNumber',
        header: 'Dataset',
      },
      {
        accessorKey: 'upload_date',
        header: 'Upload Date',
      },
      {
        accessorKey: 'summary',
        header: 'Summary',
        cell: ({ getValue }) => (
          <pre style={{ whiteSpace: 'pre-wrap', margin: 0 }}>
            {JSON.stringify(getValue(), null, 2)}
          </pre>
        ),
      },
    ],
    []
  );

  // Transform history data with dataset numbers
  const data = useMemo(() => {
    return history.map((item, index) => ({
      datasetNumber: `Dataset ${index + 1}`,
      upload_date: item.upload_date,
      summary: item.summary,
    }));
  }, [history]);

  // Initialize the table instance
  const table = useReactTable({
    data,
    columns,
    getCoreRowModel: getCoreRowModel(),
  });

  if (error) return <p>{error}</p>;
  if (!history.length) return <p>No history available</p>;

  return (
    <div>
      <h2>Upload History</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          {table.getHeaderGroups().map((headerGroup) => (
            <tr key={headerGroup.id}>
              {headerGroup.headers.map((header) => (
                <th
                  key={header.id}
                  style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}
                >
                  {header.isPlaceholder ? null : header.renderHeader()}
                </th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody>
          {table.getRowModel().rows.map((row) => (
            <tr key={row.id}>
              {row.getVisibleCells().map((cell) => (
                <td key={cell.id} style={{ border: '1px solid #ddd', padding: '8px' }}>
                  {cell.renderCell()}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default History;


